import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Auth from './components/Auth';
import ApplicantHomepage from './components/ApplicantHome';
import RecruiterHomepage from './components/RecruiterHome';
import './App.css';

function App() {
    return (
        <Router>
            <div className="App">
                <Routes>
                    <Route path="/" element={<Auth />} />
                    <Route path="/applicant-homepage" element={<ApplicantHomepage />} />
                    <Route path="/recruiter-homepage" element={<RecruiterHomepage />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
